import avatar from '../img/avatar.png';

import KeyboardDoubleArrowRightRoundedIcon from '@mui/icons-material/KeyboardDoubleArrowRightRounded';

const Home = () => {
    return (
        <div className=" h-fit grid md:grid-cols-2 gap-4">
            <div className='flex flex-col gap-2 justify-center'>
                <p className='text-lg'>Hey there! I'm <span className='text-pink-400 hover:font-bold'>Dianne</span>.</p>
                <p>I love creating elegant web experiences and captivating interfaces through front-end development. I'm also passionate about developing beautiful mobile apps with innovative functionality.</p>
                <div className='flex text-slate-500'>
                    <KeyboardDoubleArrowRightRoundedIcon />
                    <p>Let's collaborate!</p>
                </div>
            </div>

            <div>
                <img src={avatar} className=' animate-bounce' />
            </div>

        </div>
    );
}

export default Home;
